    "source": "// SPDX-License-Identifier: GPL-3.0\npragma solidity ^0.8.0;\n\ninterface ERC20Interface {\n    function totalSupply() external view returns (uint256);\n    function balanceOf(address account) external view returns (uint256);\n    function transfer(address recipient, uint256 amount) external returns (bool);\n    function approve(address spender, uint256 amount) external returns (bool);\n    function allowance(address owner, address spender) external view returns (uint256);\n    function transferFrom(address spender, address recipient, uint256 amount) external returns (bool);\n    \n    event Transfer(address indexed from, address indexed to, uint256 amount);\n    event Transfer(address indexed spender, address indexed from, address indexed to, uint256 amount);\n    event Approval(address indexed owner, address indexed spender, uint256 oldAmount, uint256 amount);\n}\n\ncontract ICToken is ERC20Interface {\n    mapping (address => uint256) private _balances;\n    mapping (address => mapping (address => uint256)) public _allowances;\n\n    uint256 public _totalSupply;\n    string public _name;\n    string public _symbol;\n    uint8 public _decimals;\n    \n    constructor(string memory getName, string memory getSymbol) {\n        _name = getName;\n        _symbol = getSymbol;\n        _decimals = 18;\n        _totalSupply = 100000000e18;\n        _balances[msg.sender] = _totalSupply;\n    }\n    \n    function name() public view returns (string memory) {\n        return _name;\n    }\n    \n    function symbol() public view returns (string memory) {\n        return _symbol;\n    }\n    \n    function decimals() public view returns (uint8) {\n        return _decimals;\n    }\n    // ERC20   \n    function totalSupply() external view virtual override returns (uint256) {\n        return _totalSupply;\n    }\n    // Owner   \n    function balanceOf(address account) external view virtual override returns (uint256) {\n        return _balances[account];\n    }\n    // ERC20 \n    function transfer(address recipient, uint amount) public virtual override returns (bool) {\n        _transfer(msg.sender, recipient, amount);\n        emit Transfer(msg.sender, recipient, amount);\n        return true;\n    }\n    // \n    // owner spender     \n    function allowance(address owner, address spender) external view override returns (uint256) {\n        return _allowances[owner][spender];\n    }\n    // spender  value     . \n    //   Approval    .\n    function approve(address spender, uint amount) external virtual override returns (bool) {\n        uint256 currentAllownace = _allowances[msg.sender][spender];\n        require(currentAllownace >= amount, \"ERC20: Transfer amount exceeds allowance\");\n        _approve(msg.sender, spender, currentAllownace, amount);\n        return true;\n    }\n    // spender      \n    function transferFrom(address sender, address recipient, uint256 amount) external virtual override returns (bool) {\n        _transfer(sender, recipient, amount);\n        emit Transfer(msg.sender, sender, recipient, amount);\n        uint256 currentAllowance = _allowances[sender][msg.sender];\n        require(currentAllowance >= amount, \"ERC20: transfer amount exceeds allowance\");\n        _approve(sender, msg.sender, currentAllowance, currentAllowance - amount);\n        return true;\n    }\n    \n    function _transfer(address sender, address recipient, uint256 amount) internal virtual {\n        require(sender != address(0), \"ERC20: transfer from the zero address\");\n        require(recipient != address(0), \"ERC20: transfer to the zero address\");\n        uint256 senderBalance = _balances[sender];\n        require(senderBalance >= amount, \"ERC20: transfer amount exceeds balance\");\n        _balances[sender] = senderBalance - amount;\n        _balances[recipient] += amount;\n    }\n    \n    function _approve(address owner, address spender, uint256 currentAmount, uint256 amount) internal virtual {\n        require(owner != address(0), \"ERC20: approve from the zero address\");\n        require(spender != address(0), \"ERC20: approve to the zero address\");\n        require(currentAmount == _allowances[owner][spender], \"ERC20: invalid currentAmount\");\n        _allowances[owner][spender] = amount;\n        emit Approval(owner, spender, currentAmount, amount);\n    }\n}",
